"""
给定一个字符串 s 和一个非空字符串 p，找到 s 中所有是 p 的字母异位词的子串，返回这些子串的起始索引。

字符串只包含小写英文字母，并且字符串 s 和 p 的长度都不超过 20100。

说明：

字母异位词指字母相同，但排列不同的字符串。
不考虑答案输出的顺序。
示例 1:

输入:
s: "cbaebabacd" p: "abc"

输出:
[0, 6]

解释:
起始索引等于 0 的子串是 "cba", 它是 "abc" 的字母异位词。
起始索引等于 6 的子串是 "bac", 它是 "abc" 的字母异位词。
 示例 2:

输入:
s: "abab" p: "ab"

输出:
[0, 1, 2]

解释:
起始索引等于 0 的子串是 "ab", 它是 "ab" 的字母异位词。
起始索引等于 1 的子串是 "ba", 它是 "ab" 的字母异位词。
起始索引等于 2 的子串是 "ab", 它是 "ab" 的字母异位词
"""

from typing import List

class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        # 超出时间限制
        # len_p = len(p)
        # len_s=len(s)
        #
        # dict_p = self.transfer_dict(p)
        #
        # result=[]
        # for index, val in enumerate(s):
        #     l, r = index, index+len_p
        #     if r>len_s:
        #         break
        #
        #     if self.transfer_dict(s[l:r])==dict_p:
        #         result.append(index)
        #
        # return result
        len_p = len(p)
        len_s = len(s)
        result=[]

        p_letter = [0 for i in range(26)]
        between_letter=[0 for i in range(26)]

        for i in p:
            p_letter[ord(i)-ord('a')] += 1

        l,r=0,0

        while r < len_s:

            between_letter[ord(s[r])-ord('a')]+=1


            print(p_letter[ord(s[r])-ord('a')])
            while between_letter[ord(s[r])-ord('a')] > p_letter[ord(s[r])-ord('a')]:
                # 如果between_letter字母的长度大于p_letter, 则l往前进一步，知道<=

                # print(s[l],l)
                between_letter[ord(s[l])-ord('a')] -=1
                l += 1

            if r-l+1==len_p:
                result.append(l)
            r += 1
        # print(result)
        return result

    def transfer_dict(self, p):
        return {key: p.count(key) for key in set(p)}

if __name__ == '__main__':

    s="" \
      ""
    p=""

    Solution().findAnagrams(s, p)


